import React, { Component }     from 'react';
import $                        from 'jquery';
import jQuery                   from 'jquery';
import axios                    from 'axios';
import swal                     from 'sweetalert';
import TimePicker               from 'rc-time-picker';
// import DateTime from 'react-datetime';
import moment                   from 'moment';
import _                        from 'underscore';
import PlacesAutocomplete, {
  geocodeByAddress,
  getLatLng
} from "react-places-autocomplete";
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';


import "./BookingMaster.css";
import 'bootstrap/js/tab.js';
const format = "HH:mm";


class BookingMaster extends Component {

    constructor(props) {
        super(props);
        this.state = {
            showDiv                 :false,
            showAddStop             :false,
            showList             :false,
            otherPurpose             :false,
            homeAdd             :true, 
            gmapsLoaded: false,
            gmapsLoaded1: false,
            showInstuction: false,
            showPackages: false,
            toggleButtonValue       :"Round Trip",
            pickupDate              :moment(new Date).format("YYYY-MM-DD"),
            returnDate              : moment().add(1,'days').format("YYYY-MM-DD"),
            noOfdays                :"",
            fromTime                :moment(),
            from                    :"",
            to                      : "",
            toTime                  :moment(),
            purposeOfTravel         : "",
            purposeOfTravelOther         : "",
            instructions            :"",
            valueOfTab              :"",
            stopArr                 :[],
            packageTypeVal          :[],
            vehicleData             :[],
            userID                  : '' ,
            empHomeAddr             : "",
            bookingType             : "Outstation",
            showbookingForOther     :false,
            isBookingForOther       :false,
            empWorkAddr             : "",
            radioButtonValue        : "Home",
            address                 : "",
            selectedVehicle         : "",
            fromLatLng              : [],
            toLatLng                : [],
            stopLatLng              : [],
            tripArray               : [],
            vehicleCategoryId       : "",
            fromArea                : "",
            fromCity                : "",
            fromDistrict                : "",
            fromState               : "",
            fromCountry             : "",
            fromPincode             : "",
            address1             : "",
            toaddress1             : "",
            toArea                  : "",
            toCity                  : "",
            toDistrict                  : "",
            toState                 : "",
            toCountry               : "",
            toPincode               : "",
            stopAddress1                  : "",
            stopArea                  : "",
            stopCity                  : "",
